import React from "react";

export const Button = ({
  label = "Button",
  type = "button",
  className = "",
  disabled = false,
}) => {
  return (
    <>
      <button
        type={type}
        className={`text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:outline-none focus:ring-blue-300 font-medium rounded-lg px-5 py-2.5 text-center ${className}`}
        disabled={disabled}
      >
        {label}
      </button>
    </>
  );
};
